import React from "react";
import '../../css/itinerary.css'
import rearview from '../../images/rearview.JPG'

const Select = (props) => {
  return (
    <div className='day'>

      <h4>Select your day from the side menu</h4>
      <img src={rearview} alt='Its us!' className='select-img'/>
    </div>
  );
};

export default Select;
